from django.http import HttpResponse
from hashlib import sha256
import time

# Generate a dynamic challenge token based on the current time
def generate_challenge():
    current_time = int(time.time())
    challenge = sha256(str(current_time).encode()).hexdigest()
    return challenge, current_time

# Index view function
def index(request):
    # Generate dynamic challenge and timestamp
    challenge, timestamp = generate_challenge()

    # Store the generated challenge and timestamp in the session for later validation
    request.session['challenge'] = challenge
    request.session['timestamp'] = timestamp

    # Message for the first stage
    message = f"""Hi there! Nice to meet you!

This task is meant to prove that you can automate things:

There are several steps; after completing all of them, you will receive an email address
to send your application.

NOTE: Only this script is a part of the task. You do not need to brute-force anything.

- You will receive instructions for each stage after completing the previous one.
- Read the instructions _carefully_.
- You have 5 seconds to solve each stage.

Good luck!

First stage: send GET request to /?step=1&challenge={challenge}&timestamp={timestamp}
"""

    # Validate query parameters
    step = request.GET.get('step')
    user_challenge = request.GET.get('challenge')
    user_timestamp = request.GET.get('timestamp')

    # Retrieve the stored challenge and timestamp for validation
    stored_challenge = request.session.get('challenge')
    stored_timestamp = request.session.get('timestamp')

    # Step 1 validation
    if step == '1' and user_challenge and user_timestamp:
        try:
            user_timestamp = int(user_timestamp)

            # Check if the timestamp matches the stored one and the challenge is correct
            if user_timestamp == stored_timestamp and user_challenge == stored_challenge:
                return HttpResponse("""Very good! Next stage:
Second stage: send GET request to /?step=2

Add the following headers to the request:
- X-challenge: {challenge}
- X-timestamp: {timestamp}
""".format(challenge=stored_challenge, timestamp=stored_timestamp), content_type="text/plain")
            else:
                return HttpResponse("Sorry, timestamp is too old or invalid, try again.")
        except ValueError:
            return HttpResponse("Invalid timestamp value provided.")

    # Step 2 validation
    elif step == '2':
        # Get the headers from the request
        header_challenge = request.headers.get('X-challenge')
        header_timestamp = request.headers.get('X-timestamp')

        # Check if the headers match the stored challenge and timestamp
        if header_challenge == stored_challenge and header_timestamp == str(stored_timestamp):
            
            return HttpResponse(final_message())
        else:
            return HttpResponse("Invalid headers provided for the second stage.")

    # Default response with the message in plain text format
    return HttpResponse(message, content_type="text/plain")

def final_message():
    final_message = f"""You won! Congratulations! You Have Reached To the Last Door Now.
Here's the flag encoded with an unknown number of rounds of base64 encoding:

"""
    return final_message


